日本製 FIC ハブリング一体型スペーサー　厚み5ｍｍ 外径73ｍｍ用 <BR>
<BR>
ハブリング一体形状により、高速時のブレを防止！<BR>
ワイドトレッド化による、スタイリング、スタビリティの向上。 <BR>
新開発、ハブ一体型高強度ジュラルミンにより、軽量・高精度・高耐久性を実現しました。<BR>
<BR>
■品番：HRS-554<BR>
■スペーサー厚さ：5ｍｍ<BR>
■対応PCD：100～114.3<BR>
■対応穴数：４穴・５穴<BR>
■ハブリング外径73φ（※装着ホイールの内側のハブ径が73Φ以上必要）<BR>
■対応純正ハブサイズ：54Φ<BR>
　トヨタ・マツダ・ダイハツ・スズキ車のハブ径54φのお車に対応<BR>
■入数：2枚1セット<br><br>







